  `unit_money` decimal(15, 5) NOT NULL COMMENT '单价',
  `quantity` int(11) NOT NULL COMMENT '数量',
  `rate` decimal(18, 5) NOT NULL COMMENT '税率',
  `rate_money` decimal(18, 5) NOT NULL COMMENT '税率金额',
  `post_money` decimal(18, 5) NOT NULL COMMENT '邮费',
  `merchant_rate_discount_money` decimal(18, 5) NOT NULL COMMENT '商家税费优惠金额',
  `platform_rate_discount_money` decimal(18, 5) NOT NULL COMMENT '平台税费优惠金额',
  `need_pay_money` decimal(18, 5) NOT NULL COMMENT '应付金额',
  `platform_discount_money` decimal(18, 5) NOT NULL COMMENT '平台优惠分摊',
  `merchant_discount_money` decimal(18, 5) NOT NULL COMMENT '商家优惠分摊',
  `actual_income_money` decimal(18, 5) NOT NULL COMMENT '应收金额',
  `cost_money` decimal(18, 5) NOT NULL COMMENT '成本',
  `is_custom` tinyint(1) NULL DEFAULT NULL COMMENT '是否定制片',
  `is_gift` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否赠品',
  `gift_type` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '赠品来源',
  `gift_rule_id` int(11) NULL DEFAULT NULL COMMENT '赠品规则ID',
  `product_type` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '货品类型（一件代发，普通）',
  `is_group_product` tinyint(1) NULL DEFAULT 0 COMMENT '是否组合商品',
  `group_rule_id` int(11) NULL DEFAULT NULL COMMENT '组合商品规则id',
  `send_type` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '发货方式',
  `seller_send_company_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '卖家发货快递公司',
  `seller_send_code` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '卖家发货快递单号',
  `seller_send_time` datetime(0) NULL DEFAULT NULL COMMENT '卖家发货时间',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` datetime(0) NULL DEFAULT NULL,
  `refund_quantity` int(11) NULL DEFAULT NULL COMMENT '退款数量',
  `refund_money` decimal(18, 5) NULL DEFAULT NULL COMMENT '退款金额',
  `main_product_detail_codes` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '主商品子单号',
  `is_send` tinyint(1) NULL DEFAULT 0 COMMENT '是否发货',
  `send_quantity` int(11) NULL DEFAULT 0 COMMENT '发货数量',
  `pay_money` decimal(18, 5) NULL DEFAULT 0.00000 COMMENT '实付金额',
  `weight` decimal(18, 5) NULL DEFAULT 0.00000 COMMENT '行重量',
  `payment_unit_money` decimal(18, 5) NOT NULL DEFAULT 0.00000 COMMENT '完税单价',
  `is_full_pre_sale` tinyint(1) NULL DEFAULT 0 COMMENT '是否全款预售',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uq_order_detail_code`(`order_detail_code`) USING BTREE,
  INDEX `idx_order_code`(`order_code`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

