  `attribute_model_type` int(11) NULL DEFAULT NULL COMMENT '配置模板code',
  `push_count` int(11) NULL DEFAULT NULL COMMENT '推送次数',
  `deal_status` tinyint(4) NULL DEFAULT 0 COMMENT '计算状态 0计算中 1计算完成 2计算失败 3计算停止 4创建中 5创建失败',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `creater` bigint(20) NULL DEFAULT NULL COMMENT '创建人ID',
