  `tag_group_extend_id` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '扩展id（存第三方唯一码）',
  `data_range` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '数据范围',
  `tag_detail_status` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '标签详情处理状态',
  `is_not_limit` int(11) NULL DEFAULT NULL COMMENT '是否不限制行为对象',
