  INDEX `idx_001`(`tag_group_extend_id`) USING BTREE,
  INDEX `idx_002`(`tag_group_source`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2730 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '标签组表' ROW_FORMAT = Dynamic;

