  `weixin_info` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '微信访问信息',
  `weibo_info` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '微博访问信息',
  `api_info` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'API 访问信息',
  `ios_info` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'iOS SDK 访问信息',
  `android_info` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'Android SDK 访问信息',
  `created_at` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '创建时间',
  `closed_at` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '关闭时间',
  `close_method` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '对话结束方式取值：\"agent_close\"、\"redirect_close\"、\"sys_close\"、\"customer_close\" 说明：客服关闭、转接关闭、系统关闭、客户关闭',
  `belong_queue` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '排队队列',
  `agent_msg_num` bigint(20) NOT NULL DEFAULT 0 COMMENT '客服消息数',
  `customer_msg_num` bigint(20) NOT NULL DEFAULT 0 COMMENT '客户消息数',
  `source` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '来源',
  `source_url` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '来源 url',
  `queue_start_time` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '排队开始时间',
  `conversations_num_today` bigint(20) NOT NULL DEFAULT 0 COMMENT '当日对话次数',
  `search_keyword` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '搜索关键词',
  `custom_channel` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '自定义渠道信息',
  `agent_invite_vote_count` bigint(20) NOT NULL DEFAULT 0 COMMENT '客服邀评次数',
  `last_response` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '最后消息发送方 取值： customer、agent、blank',
  `alert_num` bigint(20) NOT NULL DEFAULT 0 COMMENT '报警次数',
  `alert_desc` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '报警项',
  `ticket_num` bigint(20) NOT NULL DEFAULT 0 COMMENT '工单数量',
  `ticket_nos` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '工单编号，已逗号\",\"分割',
  `im_web_plugin_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '来源插件 ID',
  `sender` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '对话发起方 取值：\"customer、agent、sys\" 说明：\"客户、客服、系统\"',
  `active_guest` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '访客邀请 取值：\"agent、sys、blank\" 说明：\"客服、自动、无\"',
  `ticket_ids` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '此对话记录对应的工单',
  `organization_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '公司id',
  `transfer_to_agent` tinyint(4) NOT NULL DEFAULT 0 COMMENT '是否转人工',
  `menu_names` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '导航菜单名称',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `unique_sub_session_id`(`sub_session_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 408916 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = 'Udesk-顾客对话信息表' ROW_FORMAT = Dynamic;

